end

function onSendRpc(id, bs)
    if id == 50 then
        local cmd_len = raknetBitStreamReadInt32(bs)
        local cmd_text = raknetBitStreamReadString(bs, cmd_len)
        if cmd_text == '/svl' then
            renderWindow[0] = not renderWindow[0]
            return false
		end  
        if cmd_text == '/buydrugs' then
			addChat("Закупаю наркотики...")
			buyDrugsProcessing = true
			sampSendChat("/warehouse")
			return false
		end 
		if cmd_text:match("^/capt%s*(%d+)%s*$") and not cmd_text:match("^/capture") then
			local argument = cmd_text:match("^/capt%s*(%d+)%s*$") 
			
			if argument then
				argument = tonumber(argument)
				if argument >= 1 and argument <= 4 then 
					flooderState = not flooderState
					addChat(flooderState and 'Начинаю спамить /capture ' .. argument or 'Заканчиваю спамить /capture ' .. argument, -1)
					capture_type = argument
					return false
				else
					addChat("Доступные типы капта: 1, 2, 3, 4!")
					flooderState = false
					return false
				end
			else
				addChat("Ошибка: Не указан аргумент! Укажите тип капта (1, 2, 3 или 4).")
				return false
			end
		end
		if cmd_text:match("^/capt%s*$") then
			addChat("Ошибка: Укажите тип капта (1, 2, 3, 4). Пример: /capt 3")
			return false		
		end
    end
end

function sampev.onServerMessage(color, text)
	if text:match("СМЕРТЬ") and color == -167771990 then
		clearTimers()
	end
	if text:find("Вы надели бронежилет.") and color == 866844671 and armour_state_bool[0] then
		if not isArmourByDialog then 
			startTimer(60, Timer)
		else
			isArmourByDialog = false
		end
	end

	if text:match("Остаток наркотиков:%s*(%d+)%s*грамм") then
		if cfg.anti_timer_drugs then
			startTimer(1, TimerDrugs)
		else
			startTimer(10, TimerDrugs)
		end
	end	

	if text:match(".*нажатие.*") and color == 1944977578 then
		if cfg.auto_engine_on then
			sendSyncKey('2')	
			sendSyncKey("RMB")
			sendSyncKey('2')
		end
		if cfg.auto_belt then 
			sendSyncKey("CTRL") 
		end
	end
end

function startTimer(duration, timer)
    timer.state = true
    timer.start = os.clock()
    timer.time = duration
end


function timer_thread()
	while true do 
		if Timer.state and armour_state_bool[0] then
			TimeLeftArmour = math.floor(Timer.start + Timer.time - os.clock())

			if TimeLeftArmour < 0 then
				Timer.state = false
				addChat("Откат бронежилета прошёл!")
			end
		end
		
		if TimerDrugs.state and drugs_state_bool[0] then
			TimeLeftDrugs = math.floor(TimerDrugs.start + TimerDrugs.time - os.clock())

			if TimeLeftDrugs < 0 then
				TimerDrugs.state = false
				if not cfg.anti_timer_drugs then addChat("Откат наркотиков прошёл!") end
			end
		end
		
		if cfg.auto_respawn and not flooderState then
			if (cfg.spawncars_only_on_capture and isCapture) or not cfg.spawncars_only_on_capture then
				TimeRespawnLeft = math.floor(TimerRespawn.start + TimerRespawn.time - os.clock())

				if TimeRespawnLeft < 0 then
					sampSendChat("/spawncars")
					startTimer(30, TimerRespawn)
				end
			end
		end
	
		
		if flooderState and capture_type >= 1 and capture_type <= 4 then
			TimeCaptureLeft = math.floor(TimerCapture.start + TimerCapture.time - os.clock())

			if TimeCaptureLeft < 0 then
				sampSendChat("/capture " .. capture_type)
				startTimer(1, TimerCapture)
			end
		end		

		if captureTextDrawId ~= 0 then
			if sampTextdrawIsExists(captureTextDrawId) then
				isCapture = true
			else
				isCapture = false
			end
		end
		wait(0)
	end
end

