		if cfg.auto_armour then sampSendDialogResponse(id, 1, 0, "") return false end
		armourDialog = id
        text = text .. "\n \n{af053b}Misadventures \nПоложить всю броню"
        return {id, style, title, button1, button2, text}		
	end
	
	local title = title:gsub("{%x%x%x%x%x%x}", "")
	local text = text:gsub("{%x%x%x%x%x%x}", "")
	
	if title:find("Личное меню") and isCheckDrugs then
		sampSendDialogResponse(id, 1, 0, "")
		return false
	end
	if title:match("Статистика") and isCheckDrugs then
        cfg.addiction = tonumber(string.match(text, "Наркозависимость:%s*(%d+)"))	
		addChat("Наркотаймер инициализирован!")
		addChat("Наркозавимость: " .. cfg.addiction)
		isCheckDrugs = false
		saveConfig()
		return false
	end

	if text:match("В вашем рюкзаке (%d+) шт") and title:find("Бронежилеты") and isNeedPutArmour then
		local count = text:match("В вашем рюкзаке (%d+) шт")
		sampSendDialogResponse(id, 1, 0, count)
		isNeedPutArmour = false
		addChat("Вы положили " .. count .. " бронежилетов на склад!")
		return false
	end
	
	if title:find("АЗС") and text:match("количество топлива") and cfg.full_bak then
		local number = text:match("до%s(%d+)")
		sampSendDialogResponse(id, 1, 0, number)
		addChat("Скрипт автоматически заправил вас! Добавлено: " .. number .. " литров.")
		return false
	end
	if title:find("Склад") and buyDrugsProcessing then
		lua_thread.create(function()
			wait(1500)
			needBuyDrugs = text:match("Наркотики:%s*(%d+)")
			local needDrugs = 5000 - needBuyDrugs
			sampSendChat("/buydrugs " .. needDrugs)
			buyDrugsProcessing = false
			wait(300)
			addChat("Скрипт автоматически купил максимальное количество наркотиков на склад!")
		end)
		return false
	end
	if title:find("Магазин оружия") and text:match("бронежилетов") then
		armourBuyCount = tonumber(text:match("на%s(%d+)"))
		armourBuyDialogId = id
		if armourBuyCount ~= 0 then addChat("Нажмите ENTER чтобы купить максимальное количество бронежилетов!") end
	end
