function sendSyncKey(key)
    if key == nil then return end
    local inCar = isCharInAnyCar(PLAYER_PED)
    local data = inCar and samp_create_sync_data('vehicle') or samp_create_sync_data('player')
    local keyData = inCar and keysTable[key].incar or keysTable[key].onfoot
    if keyData.value == nil then return end
    if keyData.specKey then data.specialKey = keyData.value else data.keysData = keyData.value end
    data.send()
end

function samp_create_sync_data(sync_type, copy_from_player)
    local ffi = require 'ffi'
    local sampfuncs = require 'sampfuncs'
    local raknet = require 'samp.raknet'
    require 'samp.synchronization'

    copy_from_player = copy_from_player or true
    local sync_traits = {
        player = { 'PlayerSyncData', raknet.PACKET.PLAYER_SYNC, sampStorePlayerOnfootData },
        vehicle = { 'VehicleSyncData', raknet.PACKET.VEHICLE_SYNC, sampStorePlayerIncarData },
        passenger = { 'PassengerSyncData', raknet.PACKET.PASSENGER_SYNC, sampStorePlayerPassengerData },
        aim = { 'AimSyncData', raknet.PACKET.AIM_SYNC, sampStorePlayerAimData },
        trailer = { 'TrailerSyncData', raknet.PACKET.TRAILER_SYNC, sampStorePlayerTrailerData },
        unoccupied = { 'UnoccupiedSyncData', raknet.PACKET.UNOCCUPIED_SYNC, nil },
        bullet = { 'BulletSyncData', raknet.PACKET.BULLET_SYNC, nil },
        spectator = { 'SpectatorSyncData', raknet.PACKET.SPECTATOR_SYNC, nil }
    }
    local sync_info = sync_traits[sync_type]
    local data_type = 'struct ' .. sync_info[1]
    local data = ffi.new(data_type, {})
    local raw_data_ptr = tonumber(ffi.cast('uintptr_t', ffi.new(data_type .. '*', data)))
    if copy_from_player then
        local copy_func = sync_info[3]
        if copy_func then
            local _, player_id
            if copy_from_player == true then
                _, player_id = sampGetPlayerIdByCharHandle(PLAYER_PED)
            else
                player_id = tonumber(copy_from_player)
            end
            copy_func(player_id, raw_data_ptr)
        end
    end
    local func_send = function()
        local bs = raknetNewBitStream()
        raknetBitStreamWriteInt8(bs, sync_info[2])
        raknetBitStreamWriteBuffer(bs, raw_data_ptr, ffi.sizeof(data))
        raknetSendBitStreamEx(bs, sampfuncs.HIGH_PRIORITY, sampfuncs.UNRELIABLE_SEQUENCED, 1)
        raknetDeleteBitStream(bs)
    end
    local mt = {
        __index = function(t, index)
            return data[index]
        end,
        __newindex = function(t, index, value)
            data[index] = value
        end
    }
    return setmetatable({ send = func_send }, mt)
end

gangZones = {}

-- Проверка, является ли одна зона прилегающей к другой
local function isAdjacent(zone1, zone2)
    -- Проверяем, имеют ли зоны общие стороны или хотя бы одну общую точку
    return not (
        zone1.squareEnd.x < zone2.squareStart.x or -- zone1 справа от zone2
        zone1.squareStart.x > zone2.squareEnd.x or -- zone1 слева от zone2
        zone1.squareEnd.y < zone2.squareStart.y or -- zone1 сверху от zone2
        zone1.squareStart.y > zone2.squareEnd.y    -- zone1 снизу от zone2
    )
end

function getAdjacentZones(targetZoneId)
    local targetZone = gangZones[targetZoneId]
    if not targetZone then
        return {}
    end

    local adjacentZones = {}

    for id, zone in pairs(gangZones) do
        if id ~= targetZoneId then
            if isAdjacent(targetZone, zone) then
                table.insert(adjacentZones, id)
            end
        end
    end

    return adjacentZones
end

function addGangZone(id, left, up, right, down, color)
    local bs = raknetNewBitStream()
    raknetBitStreamWriteInt16(bs, id)
    raknetBitStreamWriteFloat(bs, left)
    raknetBitStreamWriteFloat(bs, up)
    raknetBitStreamWriteFloat(bs, right)
    raknetBitStreamWriteFloat(bs, down)
    raknetBitStreamWriteInt32(bs, color)
    raknetEmulRpcReceiveBitStream(108, bs)
    raknetDeleteBitStream(bs)
end

function removeGangZone(id)
    local bs = raknetNewBitStream()
    raknetBitStreamWriteInt16(bs, id)
    raknetEmulRpcReceiveBitStream(120, bs)
    raknetDeleteBitStream(bs)
end

function saveGangZones(filename)
    local zonesToSave = {}
    for zoneId, zone in pairs(gangZones) do
        table.insert(zonesToSave, {
            zoneId = zoneId,
            squareStart = { x = zone.squareStart.x, y = zone.squareStart.y },
            squareEnd = { x = zone.squareEnd.x, y = zone.squareEnd.y },
            color = zone.color
        })
    end
    xcfg.save(filename, { gangZones = zonesToSave })
end

function loadGangZones(filename)
    local loadedData = xcfg.load(filename)
    if loadedData and loadedData.gangZones then
        for _, zone in ipairs(loadedData.gangZones) do
            gangZones[zone.zoneId] = {
                squareStart = { x = zone.squareStart.x, y = zone.squareStart.y },
                squareEnd = { x = zone.squareEnd.x, y = zone.squareEnd.y },
                color = zone.color
            }
        end
    end
end

function sampev.onCreateGangZone(zoneId, squareStart, squareEnd, color)

    local loadedZones = xcfg.load(filename_gangzone) or {}
    local zonesToSave = loadedZones.gangZones or {}

    local zoneExists = false
    for _, zone in ipairs(zonesToSave) do
        if zone.zoneId == zoneId then
            zoneExists = true
            break
        end
    end

    if not zoneExists then
        table.insert(zonesToSave, {
            zoneId = zoneId,
            squareStart = { x = squareStart.x, y = squareStart.y },
            squareEnd = { x = squareEnd.x, y = squareEnd.y },
            color = color
        })
    end

    local result = xcfg.save(filename_gangzone, { gangZones = zonesToSave })

    gangZones[zoneId] = {
        squareStart = squareStart,
        squareEnd = squareEnd,
        color = color
    }
end

local removedZones = {}
local createdZones = {}

function sampev.onGangZoneFlash(zoneId, color)
	lua_thread.create(function()
		wait(1500)
		
		if not removedZones[zoneId] then
			removedZones[zoneId] = {}
		end
		if not createdZones[zoneId] then
			createdZones[zoneId] = {}
		end

		local adjacent = getAdjacentZones(zoneId)
		
		for _, id in ipairs(adjacent) do
			local zone = gangZones[id]
			if zone then
				removedZones[zoneId][id] = zone
				removeGangZone(id)
				
				addGangZone(id, zone.squareStart.x, zone.squareStart.y, zone.squareEnd.x, zone.squareEnd.y, 10910910908)
				createdZones[zoneId][id] = true		
			end
		end
	end)
end

function sampev.onGangZoneStopFlash(zoneId)
    if createdZones[zoneId] then

        for id, _ in pairs(createdZones[zoneId]) do
            removeGangZone(id)
        end
        createdZones[zoneId] = nil
    end

    if removedZones[zoneId] then
        for id, zone in pairs(removedZones[zoneId]) do
            addGangZone(id, zone.squareStart.x, zone.squareStart.y, zone.squareEnd.x, zone.squareEnd.y, zone.color)
        end
        removedZones[zoneId] = nil
    end
end

