function calculateDrugsNeeded()
    local hpPerDrug = 10
	local maxDrugs = 3
	
	if cfg.addiction >= 4000 then maxDrugs = 5 maxHP = 140 end
	if cfg.addiction >= 5000 then maxDrugs = 8 maxHP = 160 end
	
	local hp = getCharHealth(PLAYER_PED)
	
    local hpToRestore = maxHP - hp

    if hpToRestore <= 0 then
        return 0
    end

    local DrugsNeeded = math.ceil(hpToRestore / hpPerDrug)

    if DrugsNeeded > maxDrugs then
        DrugsNeeded = maxDrugs
    end

    return DrugsNeeded
end

